環境に優しい新冷媒(R407C)採用。<br>冷房能力は1.8kW(60Hz)<br>移動に便利な取っ手付き。<br>冷風ダクトは360°回転可能(手動)オプション。<br>キャスター付きで移動が簡単。<br>◆電源/単相100V 50/60Hz<br>◆定格電流/6.7A・6.85A<br>◆消費電力/600/675W<br>◆冷房能力/1.7・1.8kW<br>◆タンク容量/3L<br>◆冷媒/HFC R407C(310g)<br>◆騒音値/60・62dB<br>◆電源コード/約1.8m<br>◆保証期間/1年間<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：株式会社イトウ<br>商品サイズ：47.5×26.5×61cm<br>重量：約23kg<br>素材・成分：スチール<br><br>購入単位：1台<br><table width=610 border=0 cellspacing=0><tr><td bgcolor=#ffffff><p style=margin:10px;>配送種別：<b>別送品　<font color=#ff0000>代引不可　返品不可　配送日時指定不可</font></b><br><font size=2>　※商品はメーカーより直送させて頂くため、代金引換でのご注文はお受け致しかねます。<br>　※こちらの商品は他の商品とは別のお届けとなります。<br>　※メーカー直送のため、納品・請求書は商品とは別に郵送させていただきます。<br>　※商品はメーカーより直送させて頂くため、ご希望配送日時の指定はできません。<br>　※メーカーにて欠品発生時はこちらからご連絡させて頂くこともございます。</font><br><br>※北海道・沖縄・離島は送料別途見積りとなります。</p></td></tr></table></p></td></tr></table><img src=http://image.rakuten.co.jp/onestep/cabinet/parts/pix_daibi.gif><img src=http://image.rakuten.co.jp/onestep/cabinet/parts/pix_henpin.gif><br><br><br><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>お買い得 げきやす 最安値挑戦 さいやすねちょうせん P95026 9N1177 9ｎ1177 4511340006202 SAC-800N 株式会社イトウ 家電 かでん 電化製品 でんかせいひん 空調機器 空調 くうちょう 扇風機 せんぷうき サーキュレーター さーきゅれーたー ファン ふぁん リビング 収納扇 しゅうのうせん 部屋 へや オフィス電化 オフィスデンカ クーラー くーらー ミニスポットクーラー みにすぽっとくーらー 空調循環器 くうちょうじゅんかんき</font></td></tr></table><style type="text/css">
